import React from 'react';
import FormsPanel from '../forms-panel';
import { CellList } from '../cell-list';
import './app.css';

import Test from '../test-styled-components/test-styled-components';

const App = () => {
  return (
    <div className="app">
      <Test />
      <FormsPanel />
      <CellList />
    </div>
  )
};

export default App;
